import React from "react";
import DeviceList from "../components/DeviceList";
import DeviceStatus from "../components/DeviceStatus";
import { css } from "@emotion/react";
import styled from "@emotion/styled";
import { Link } from "react-router-dom";
import DeviceModel from "../components/DeviceModel";
import DashboardFilter from "../components/SearchPage/DashboardFilter";

const ParentContainer = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: flex-start;
  flex-wrap: wrap;
  margin: 1rem;
  border: 3px solid darkblue;
  border-radius: 10px;
  max-width: 70% vw;
  max-height: 70% vh;
`;

const ChildContainer = styled.div`
  display: flex;
  margin: 1rem;
  border: 5px solid black;
  border-radius: 10px;
  background-color: #d9dedd;
  align-items: center;
`;

const LinkStyle = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 2rem;
  border: 5px solid black;
  border-radius: 10px;
  background-color: #d9dedd;
  width: 100px;
  height: 35px;
`;

const MainDiv = styled.div`
  margin: 1rem;
  padding-top: 5rem;
`;

const PageStyle = styled.div`
  display: row-fluid;
  border: 5px solid gray;
  border-radius: 10px;
  background-color: #d9dedd;
  height: 100%;
  justify-content: center;
  text-align: center;
`;

const Filter = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: center;
  margin: 1rem;
  border: 3px solid darkblue;
  border-radius: 10px;
  max-width: 70% vw;
  max-height: 70% vh;
`;

function Dashboard() {
  return (
    <MainDiv>
      <Filter>
      <DashboardFilter />
      </Filter>
      <PageStyle>
        <ParentContainer>
          <ChildContainer>
            <DeviceList />
          </ChildContainer>
          <ChildContainer>
            <DeviceModel />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
        </ParentContainer>
        <ParentContainer>
          <ChildContainer>
            <DeviceList />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
        </ParentContainer>
      </PageStyle>
    </MainDiv>
  );
}

export default Dashboard;
